const userDelete = (id_usuario) => {
  var requestOptions = {
    method: "DELETE",
  };
  fetch("http://localhost:3004/usuario/" + +"", requestOptions)
    .then((response) => response.json())
    .catch((error) => console.log("error", error));
};

export default userDelete;
